import React, { useState } from 'react';
import '../style/Ham.scss';

const Ham = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      <div className={`hamburger-menu ${isOpen ? 'open' : ''}`} onClick={toggleMenu}>
        <div></div>
        <div></div>
        <div></div>
      </div>

      <div className={`menu ${isOpen ? 'open' : ''}`}>
        <div className="menu-item">
          <a href="/login">로그인</a>
        </div>
        <div className="menu-item">
          <a href="/ranking">랭킹</a>
        </div>
        <div className="menu-item">
          <a href="/luxury">럭셔리</a>
        </div>
        <div className="menu-item">
          <a href="/men">남성</a>
        </div>
        <div className="menu-item">
          <a href="/women">여성</a>
        </div>
      </div>
    </div>
  );
};

export default Ham;
